import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "..notes/Note";

function createNotes(notes){
    return(
        < Note
        key = {notes.key}
        title = {notes.title}
        content = {notes.content}
        />
    )
}

function App(){
    return(
        <div>
            <Header />
            {notes.map(createNotes)}
            <Footer />
        </div>
    );
}

export default App;
